TITLE:
  - This test tests the starting Dirichlet boundary condition of the
  - 'porofluidmultiphase framework: This means that for the first 5 time'
  - steps (time can be specified) a Dirichlet boundary condition is
  - applied to the poro-field and then switched off. This DBC is
  - 'described by a function, as usual.'
  - 'For tumor-growth modeling, large pressure gradients arise at the'
  - edge of the tumor and therefore convergence is often not reached
  - 'in the first time step. In this case, such a pressure gradient can'
  - be ramped up over the first time steps with the starting Dirichlet
  - boundary condition to facilitate convergence.
