FUNCT1:
  - VARFUNCTION: "gamma_t_growth*(phi1-w_nl_crit)/(w_nl_env-w_nl_crit)*heaviside((phi1-w_nl_crit)/(w_nl_env-w_nl_crit))*(1-phi2)*porosity*S1*heaviside(S1-0.1)"
    NUMCONSTANTS: 3
    CONSTANTS:
      gamma_t_growth: 1e-08
      w_nl_crit: 1e-06
      w_nl_env: 4.2e-06
FUNCT2:
  - VARFUNCTION: "gamma_t_necr*(w_nl_crit-phi1)/(w_nl_env-w_nl_crit)*heaviside((w_nl_crit-phi1)/(w_nl_env-w_nl_crit))*(1-phi2)*porosity*S1*heaviside(S1-0.1)"
